#include <bits/stdc++.h>
using namespace std;

string binaryToText(const string& binary) {
    string text = "";
    for (size_t i = 0; i < binary.length(); i += 8) {
        string byte = binary.substr(i, 8);
        char ch = static_cast<char>(bitset<8>(byte).to_ulong());
        text += ch;
    }
    return text;
}

int main() {
    cout << binaryToText("") << endl;

    return 0;
}
